'''Blurberry''' is the barman running the [[Blurberry Bar]]. Players must speak before being allowed to play the [[Gnome Restaurant]] [[Minigames|minigame]]. He is also used to get the drink required to complete the [[Recipe for Disaster]] [[Quests|quest]]. He is found on the {{FloorNumber|uk=1}} of the [[Grand Tree]], just east of the ladder in the [[Tree Gnome Stronghold]]. He also plays a minor role in the [[Monkey Madness I]] quest. You can speak to him using the [[NPC Contact]] spell.

